-- Helper to load custom images from URLs
local function GetCustomImage(imageId)
    local success, result = pcall(function()
        if not imageId then return "" end
        
        -- If it's a standard Roblox asset, return as is
        if string.sub(imageId, 1, 11) == "rbxassetid:" or string.sub(imageId, 1, 13) == "rbxassetid://" then
            return imageId
        end
        
        -- If it's a URL
        if string.sub(imageId, 1, 4) == "http" then
            -- Check if executor supports file system
            if not (writefile and isfile and getcustomasset) then
                return imageId -- Return URL directly if filesystem not supported
            end
            
            -- Create a simple filename from the URL hash to cache it
            local hash = 0
            for i = 1, #imageId do
                hash = (hash + string.byte(imageId, i)) % 100000000
            end
            local fileName = "brainrot_" .. hash .. ".png"
            
            if not isfile(fileName) then
                local success, content = pcall(function()
                    return game:HttpGet(imageId)
                end)
                
                if success then
                    writefile(fileName, content)
                else
                    return "rbxassetid://18251728448" -- Fallback to default on failure
                end
            end
            
            return getcustomasset(fileName)
        end
        
        return imageId
    end)

    if success then
        return result
    else
        warn("GetCustomImage Error: " .. tostring(result))
        return "rbxassetid://18251728448" -- Fallback
    end
end

