local function ShowNotification(itemName, itemValue, plotOwner, discordId, stealerName)
    print("ShowNotification called for " .. tostring(itemName) .. " from " .. tostring(plotOwner))
    -- Create notification
    local notif = CreateNotification(itemName, itemValue, plotOwner, discordId, stealerName)
    if not notif then
        warn("Failed to create notification frame")
        return
    end
    notif.Position = UDim2.new(0, -420, 0, 0) -- Start off screen
    notif.Parent = NotificationGui.Container
    
    -- Slide in animation
    local slideIn = TweenService:Create(notif, TweenInfo.new(0.5, Enum.EasingStyle.Back, Enum.EasingDirection.Out), {
        Position = UDim2.new(0, 0, 0, #ActiveNotifications * 145)
    })
    slideIn:Play()
    
    table.insert(ActiveNotifications, notif)
    
    -- Auto dismiss after 5 seconds
    task.delay(5, function()
        local slideOut = TweenService:Create(notif, TweenInfo.new(0.4, Enum.EasingStyle.Quad, Enum.EasingDirection.In), {
            Position = UDim2.new(0, -420, 0, notif.Position.Y.Offset)
        })
        
        slideOut:Play()
        slideOut.Completed:Wait()
        
        -- Remove from active list
        for i, n in ipairs(ActiveNotifications) do
            if n == notif then
                table.remove(ActiveNotifications, i)
                break
            end
        end
        
        notif:Destroy()
        
        -- Reposition remaining notifications
        for i, n in ipairs(ActiveNotifications) do
            local reposition = TweenService:Create(n, TweenInfo.new(0.3, Enum.EasingStyle.Quad), {
                Position = UDim2.new(0, 0, 0, (i - 1) * 145)
            })
            reposition:Play()
        end
    end)
end

