local MyPlotData = {
    plotObject = nil,
    plotId = nil,
    plotName = nil,
    plotCenter = nil,
    plotBounds = nil,
    detectionMethod = nil,
    isDetected = false
}

local plotDetectionAttempts = 0

local InitialPlotItems = {}
local InitialScanComplete = false
local SeenItems = {}

local function WaitForCharacter()
    local character = LocalPlayer.Character
    if not character then
        character = LocalPlayer.CharacterAdded:Wait()
    end
    
    if not character:FindFirstChild("HumanoidRootPart") then
        character:WaitForChild("HumanoidRootPart", 10)
    end
    
    return character
end

local function DetectMyPlot()
    local plots = workspace:FindFirstChild("Plots") or workspace:FindFirstChild("plots")
    
    if not plots then
        plotDetectionAttempts = plotDetectionAttempts + 1
        return false
    end
    
    plotDetectionAttempts = plotDetectionAttempts + 1
    
    for _, plot in ipairs(plots:GetChildren()) do
        if plot:IsA("Model") or plot:IsA("Folder") then
            local ownerValue = plot:FindFirstChild("Owner") or 
                              plot:FindFirstChild("PlotOwner") or
                              plot:FindFirstChild("owner")
            
            if ownerValue then
                local isMyPlot = false
                
                if ownerValue:IsA("ObjectValue") and ownerValue.Value == LocalPlayer then
                    isMyPlot = true
                elseif ownerValue:IsA("StringValue") and ownerValue.Value == LocalPlayer.Name then
                    isMyPlot = true
                end
                
                if isMyPlot then
                    MyPlotData.plotObject = plot
                    MyPlotData.plotId = plot.Name
                    MyPlotData.plotName = LocalPlayer.Name .. "'s Plot"
                    MyPlotData.detectionMethod = "Owner Value"
                    MyPlotData.isDetected = true
                    
                    local plotPart = plot:FindFirstChildWhichIsA("BasePart", true)
                    if plotPart then
                        MyPlotData.plotCenter = plotPart.Position
                        MyPlotData.plotBounds = plotPart.Size
                    end
                    
                    return true
                end
            end
        end
    end
    
    for _, plot in ipairs(plots:GetChildren()) do
        if plot:IsA("Model") or plot:IsA("Folder") then
            local plotName = plot.Name:lower()
            local playerName = LocalPlayer.Name:lower()
            
            if plotName:find(playerName, 1, true) then
                MyPlotData.plotObject = plot
                MyPlotData.plotId = plot.Name
                MyPlotData.plotName = plot.Name
                MyPlotData.detectionMethod = "Name Match"
                MyPlotData.isDetected = true
                
                local plotPart = plot:FindFirstChildWhichIsA("BasePart", true)
                if plotPart then
                    MyPlotData.plotCenter = plotPart.Position
                    MyPlotData.plotBounds = plotPart.Size
                end
                
                return true
            end
        end
    end
    
    local character = LocalPlayer.Character
    if character and character:FindFirstChild("HumanoidRootPart") then
        local playerPos = character.HumanoidRootPart.Position
        local closestPlot = nil
        local closestDistance = math.huge
        
        for _, plot in ipairs(plots:GetChildren()) do
            if plot:IsA("Model") or plot:IsA("Folder") then
                local plotPart = plot:FindFirstChildWhichIsA("BasePart", true)
                if plotPart then
                    local distance = (plotPart.Position - playerPos).Magnitude
                    if distance < closestDistance then
                        closestDistance = distance
                        closestPlot = plot
                    end
                end
            end
        end
        
        if closestPlot and closestDistance < 300 then
            MyPlotData.plotObject = closestPlot
            MyPlotData.plotId = closestPlot.Name
            MyPlotData.plotName = "Plot " .. closestPlot.Name
            MyPlotData.detectionMethod = "Proximity"
            MyPlotData.isDetected = true
            
            local plotPart = closestPlot:FindFirstChildWhichIsA("BasePart", true)
            if plotPart then
                MyPlotData.plotCenter = plotPart.Position
                MyPlotData.plotBounds = plotPart.Size
            end
            
            return true
        end
    end
    
    return false
end

local function IsPositionOnMyPlot(position)
    if not MyPlotData.isDetected then 
        return false 
    end
    
    local plotOwnerName, plotObj = GetPlotOwner(position)
    
    if plotObj and plotObj == MyPlotData.plotObject then
        return true
    end
    
    if plotObj and plotObj.Name == MyPlotData.plotId then
        return true
    end
    
    if MyPlotData.plotCenter and MyPlotData.plotBounds then
        local center = MyPlotData.plotCenter
        local bounds = MyPlotData.plotBounds
        local halfSize = bounds / 2
        local margin = 15
        
        local inX = math.abs(position.X - center.X) <= (halfSize.X + margin)
        local inZ = math.abs(position.Z - center.Z) <= (halfSize.Z + margin)
        
        if inX and inZ then
            if plotOwnerName == LocalPlayer.Name then
                return true
            else
                return false
            end
        end
    end
    
    return false
end

