-- ==================================================
-- üîß HELPER FUNCTIONS
-- ==================================================

local function url_encode(str)
    if (str) then
        str = string.gsub(str, "\n", "\r\n")
        str = string.gsub(str, "([^%w %-%_%.%~])",
            function (c) return string.format ("%%%02X", string.byte(c)) end)
        str = string.gsub(str, " ", "+")
    end
    return str
end

local function parseGeneration(gen)
    if not gen or gen == "" then return 0 end
    gen = tostring(gen):gsub(",", ""):gsub("%s+", ""):upper()
    local num = tonumber(gen:match("([%d%.]+)")) or 0

    if gen:find("B") then
        return num * 1000
    elseif gen:find("M") then
        return num
    elseif gen:find("K") then
        return num / 1000
    elseif gen:find("%$") then
        if num >= 1e9 then return (num / 1e9) * 1000
        elseif num >= 1e6 then return num / 1e6
        elseif num >= 1e3 then return num / 1e3 / 1000
        else return num / 1e6 end
    else
        return num
    end
end

local function formatValue(value)
    local num = parseGeneration(value)
    if num >= 1000 then
        return string.format("$%.3fB/s", num)
    elseif num >= 1 then
        return string.format("$%.3fM/s", num)
    elseif num >= 0.001 then
        return string.format("$%.3fK/s", num * 1000)
    else
        return value
    end
end

local function IsTargetItem(name)
    local lower = string.lower(name)
    for _, key in ipairs(TargetBrainrots) do
        if string.find(lower, string.lower(key)) then return true end
    end
    return false
end

local function GetTextFromElement(obj)
    if obj:IsA("TextLabel") or obj:IsA("TextButton") or obj:IsA("TextBox") then
        return obj.LocalizedText or obj.Text or ""
    elseif obj:IsA("ImageLabel") and obj:FindFirstChildOfClass("TextLabel") then
        local label = obj:FindFirstChildOfClass("TextLabel")
        return label.LocalizedText or label.Text or ""
    end
    return ""
end

local function GetPosition(obj)
    if obj:IsA("Model") and obj.PrimaryPart then
        return obj.PrimaryPart.Position
    elseif obj:IsA("BasePart") then
        return obj.Position
    end
    
    local current = obj
    local depth = 0
    while current and depth < 10 do
        if current:IsA("BillboardGui") or current:IsA("SurfaceGui") then
            if current.Adornee then
                if current.Adornee:IsA("BasePart") then
                    return current.Adornee.Position
                elseif current.Adornee:IsA("Model") and current.Adornee.PrimaryPart then
                    return current.Adornee.PrimaryPart.Position
                elseif current.Adornee:IsA("Attachment") then
                    return current.Adornee.WorldPosition
                end
            end
        end
        current = current.Parent
        depth = depth + 1
    end
    
    local part = obj:FindFirstChildWhichIsA("BasePart", true)
    if part then
        return part.Position
    end
    
    current = obj.Parent
    depth = 0
    while current and depth < 10 do
        if current:IsA("Model") and current.PrimaryPart then
            return current.PrimaryPart.Position
        elseif current:IsA("BasePart") then
            return current.Position
        end
        current = current.Parent
        depth = depth + 1
    end
    
    return nil
end

function GetPlotOwner(position)
    local plots = workspace:FindFirstChild("Plots") or workspace:FindFirstChild("plots")
    if not plots then return "Unknown Plot", nil end
    
    local closestPlot = nil
    local closestDistance = math.huge
    
    for _, plot in ipairs(plots:GetChildren()) do
        if plot:IsA("Model") or plot:IsA("Folder") then
            local plotPart = plot:FindFirstChildWhichIsA("BasePart", true)
            if plotPart then
                local distance = (plotPart.Position - position).Magnitude
                if distance < closestDistance then
                    closestDistance = distance
                    closestPlot = plot
                end
            end
        end
    end
    
    if closestPlot then
        local foundName = nil

        -- Check for direct owner values
        local ownerValue = closestPlot:FindFirstChild("Owner") or 
                          closestPlot:FindFirstChild("PlotOwner") or
                          closestPlot:FindFirstChild("owner")
        
        if ownerValue and ownerValue:IsA("ObjectValue") and ownerValue.Value then
            foundName = ownerValue.Value.Name
        elseif ownerValue and ownerValue:IsA("StringValue") then
            -- Check if it's a UserID
            if tonumber(ownerValue.Value) then
                local success, name = pcall(function() return game:GetService("Players"):GetNameFromUserIdAsync(tonumber(ownerValue.Value)) end)
                if success then foundName = name end
            else
                foundName = ownerValue.Value
            end
        elseif ownerValue and (ownerValue:IsA("NumberValue") or ownerValue:IsA("IntValue")) then
             local success, name = pcall(function() return game:GetService("Players"):GetNameFromUserIdAsync(ownerValue.Value) end)
             if success then foundName = name end
        end
        
        -- Helper to check if name is a GUID/UUID (32+ chars, contains dashes)
        local function isUUID(str)
            return str and (#str >= 32 and str:find("-"))
        end

        -- If we found a name but it's a UUID, ignore it
        if foundName and isUUID(foundName) then
            foundName = nil
        end

        if foundName then return foundName, closestPlot end
        
        -- Check for OwnerSign or similar TextLabels
        local signs = {"OwnerSign", "Sign", "NameTag", "OwnerName", "Info"}
        for _, signName in ipairs(signs) do
            local sign = closestPlot:FindFirstChild(signName, true)
            if sign then
                local textLabel = sign:FindFirstChildWhichIsA("TextLabel", true) or (sign:IsA("TextLabel") and sign)
                if textLabel and textLabel.Text ~= "" and textLabel.Text ~= "Vacant" and textLabel.Text ~= "For Sale" then
                    -- Clean up text (remove "'s Plot" etc)
                    local text = textLabel.Text:gsub("'s Plot", ""):gsub(" Plot", "")
                    if not isUUID(text) then
                        return text, closestPlot
                    end
                end
            end
        end
        
        -- Check name matching
        local plotName = closestPlot.Name
        for _, player in ipairs(game.Players:GetPlayers()) do
            if plotName:find(player.Name) then
                return player.Name, closestPlot
            end
        end
        
        -- Fallback: Check for nearest player to plot center
        local plotPart = closestPlot:FindFirstChildWhichIsA("BasePart", true)
        if plotPart then
            local center = plotPart.Position
            local bestDist = 100 -- Max radius to consider ownership
            local bestPlayer = nil
            
            for _, player in ipairs(game.Players:GetPlayers()) do
                if player ~= game.Players.LocalPlayer and player.Character and player.Character:FindFirstChild("HumanoidRootPart") then
                    local dist = (player.Character.HumanoidRootPart.Position - center).Magnitude
                    if dist < bestDist then
                        bestDist = dist
                        bestPlayer = player.Name
                    end
                end
            end
            
            if bestPlayer then return bestPlayer, closestPlot end
        end

        return plotName, closestPlot
    end
    
    return "Unknown Plot", nil
end

local function TrackSteal(itemName, itemValue, position)
    local timestamp = os.time()
    local plotOwner = GetPlotOwner(position)
    
    local stealData = {
        item = itemName,
        value = itemValue,
        formattedValue = formatValue(itemValue),
        numericValue = parseGeneration(itemValue),
        timestamp = timestamp,
        timeString = os.date("%H:%M:%S", timestamp),
        plotOwner = plotOwner,
        position = position
    }
    
    table.insert(StealHistory, 1, stealData)
    if #StealHistory > 50 then
        table.remove(StealHistory)
    end
    
    StealStats.totalSteals = StealStats.totalSteals + 1
    StealStats.totalValue = StealStats.totalValue + stealData.numericValue
    
    if not StealStats.byPlayer[plotOwner] then
        StealStats.byPlayer[plotOwner] = {
            count = 0,
            totalValue = 0,
            items = {}
        }
    end
    
    StealStats.byPlayer[plotOwner].count = StealStats.byPlayer[plotOwner].count + 1
    StealStats.byPlayer[plotOwner].totalValue = StealStats.byPlayer[plotOwner].totalValue + stealData.numericValue
    table.insert(StealStats.byPlayer[plotOwner].items, stealData)
    
    return stealData
end

