local function SendLog(itemName, itemValue, plotOwner, discordId)
    warn("[DEBUG] SendLog called: " .. tostring(itemName) .. ", " .. tostring(plotOwner) .. " | URL: " .. tostring(SERVER_URL))
    local idToSend = user_id or LocalPlayer.UserId
    local nameToSend = LocalPlayer.Name
    
    -- Include discord_id parameter if provided
    -- For backward compatibility with older server versions, we send the stealer's name as 'discord_id'
    -- This ensures the name shows up even if the server hasn't been updated to support 'stealer_name'
    local url
    if discordId and discordId ~= "" then
        url = string.format("%s/log_steal?user_id=%s&item=%s&value=%s&plot=%s&discord_id=%s&stealer_name=%s", 
            SERVER_URL, 
            idToSend, 
            url_encode(itemName or "Unknown"), 
            url_encode(tostring(itemValue) or "N/A"),
            url_encode(plotOwner or "Unknown"),
            url_encode(nameToSend), -- Use nameToSend instead of discordId to fix display
            url_encode(nameToSend))
    else
        url = string.format("%s/log_steal?user_id=%s&item=%s&value=%s&plot=%s&discord_id=%s&stealer_name=%s", 
            SERVER_URL, 
            idToSend, 
            url_encode(itemName or "Unknown"), 
            url_encode(tostring(itemValue) or "N/A"),
            url_encode(plotOwner or "Unknown"),
            url_encode(nameToSend), -- Force send name as discord_id
            url_encode(nameToSend))
    end
    
    print("Sending webhook to: " .. url)
    local success, err = pcall(function()
        game:HttpGet(url)
    end)
    
    if success then
        print("Webhook sent successfully")
        StealStats.totalLogged = StealStats.totalLogged + 1
    else
        warn("Webhook failed: " .. tostring(err))
    end
    
    return success
end

local function TrackPendingSteal(itemName, itemValue, plotOwner, discordId)
    local pending = {
        name = itemName,
        nameLower = string.lower(itemName),
        value = itemValue,
        plotOwner = plotOwner,
        discordId = discordId or "",
        timestamp = os.time()
    }
    
    table.insert(PendingSteals, pending)
end

