local function ScanAndCacheAllItems()
    itemCache = {}
    
    local function ScanObject(obj, location)
        if obj:IsA("TextLabel") or obj:IsA("TextButton") or obj:IsA("TextBox") or obj:IsA("ImageLabel") then
            local text = GetTextFromElement(obj)
            local displayText = string.lower(text)
            
            if obj.Name == "DisplayName" and IsTargetItem(displayText) then
                local parent = obj.Parent
                if parent then
                    local generation = nil
                    
                    for _, child in ipairs(parent:GetChildren()) do
                        local childText = GetTextFromElement(child)
                        local childName = string.lower(child.Name or "")
                        
                        if childText ~= "" then
                            if childName:find("mutation") or childName:find("rarity") then
                                continue
                            end
                            
                            local textLower = string.lower(childText)
                            if textLower == "stolen" or textLower == "fusing" or textLower == "equipped" or 
                               textLower == "gold" or textLower == "secret" then
                                continue
                            end
                            
                            if childText:match("/s") and (childText:match("%$") or childText:match("%d+[BMK]")) then
                                generation = childText
                                break
                            end
                            
                            if (childName:find("generation") or childName:find("gen")) and 
                               not childName:find("mutation") and not childName:find("rarity") then
                                if childText:match("%$") or childText:match("%d+[BMK]") or childText:match("/s") then
                                    generation = childText
                                    break
                                end
                            end
                            
                            if childText:match("^G%d+") or childText:match("^G%d+%s") then
                                generation = childText
                                break
                            end
                            
                            if (childText:match("%$") or childText:match("%d+[BMK]")) and 
                               not childName:find("mutation") and not generation then
                                generation = childText
                            end
                        end
                    end
                    
                    if generation then
                        local position = GetPosition(parent)
                        
                        if position then
                            table.insert(itemCache, {
                                name = text,
                                nameLower = displayText,
                                generation = generation,
                                position = position,
                                location = location,
                                parent = parent
                            })
                        else
                            table.insert(itemCache, {
                                name = text,
                                nameLower = displayText,
                                generation = generation,
                                position = Vector3.new(0, 0, 0),
                                location = location,
                                parent = parent,
                                noPosition = true
                            })
                        end
                    end
                end
            end
        end
    end
    
    for _, obj in ipairs(workspace:GetDescendants()) do
        ScanObject(obj, "WORKSPACE")
    end
    
    for _, player in ipairs(game.Players:GetPlayers()) do
        if player.Character then
            for _, obj in ipairs(player.Character:GetDescendants()) do
                ScanObject(obj, "PLAYER:" .. player.Name)
            end
        end
    end
    
    -- Scan LocalPlayer Backpack
    if LocalPlayer and LocalPlayer.Backpack then
        for _, obj in ipairs(LocalPlayer.Backpack:GetDescendants()) do
            ScanObject(obj, "BACKPACK")
        end
    end
end

local function ScanInitialPlotItems()
    if not MyPlotData.isDetected then
        return
    end
    
    ScanAndCacheAllItems()
    
    for _, item in ipairs(itemCache) do
        if not item.noPosition and IsPositionOnMyPlot(item.position) then
            local key = item.nameLower .. "_" .. item.generation
            InitialPlotItems[key] = true
            SeenItems[key] = true
        end
    end
    
    InitialScanComplete = true
end

