local function MonitorForNewItems()
    task.spawn(function()
        while task.wait(0.5) do
            pcall(function()
                if not MyPlotData.isDetected or not InitialScanComplete then
                    return
                end
                
                local character = LocalPlayer.Character
                if not character or not character:FindFirstChild("HumanoidRootPart") then
                    return
                end
                
                for _, item in ipairs(itemCache) do
                    local isSecured = false
                    
                    if not item.noPosition and IsPositionOnMyPlot(item.position) then
                        isSecured = true
                    elseif item.location == "PLAYER:" .. LocalPlayer.Name or item.location == "BACKPACK" then
                        isSecured = true
                    end
                    
                    if isSecured then
                        local key = item.nameLower .. "_" .. item.generation
                        
                        if not InitialPlotItems[key] and not SeenItems[key] then
                            SeenItems[key] = true
                            
                            for j = #PendingSteals, 1, -1 do
                                local pending = PendingSteals[j]
                                
                                if item.nameLower == pending.nameLower then
                                    warn("[DEBUG] Match found for steal: " .. item.name)
                                    -- Show UI notification with Discord ID
                                    ShowNotification(item.name, item.generation, pending.plotOwner, pending.discordId, LocalPlayer.Name)
                                    
                                    -- Send to webhook with Discord ID
                                    SendLog(item.name, item.generation, pending.plotOwner, pending.discordId)
                                    table.remove(PendingSteals, j)
                                    break
                                end
                            end
                        end
                    end
                end
            end)
        end
    end)
end

local function MonitorForSteals()
    task.spawn(function()
        while task.wait(0.3) do
            pcall(function()
                if not MyPlotData.isDetected or not InitialScanComplete then
                    return
                end
                
                local character = LocalPlayer.Character
                if not character or not character:FindFirstChild("HumanoidRootPart") then
                    return
                end
                
                local playerPos = character.HumanoidRootPart.Position
                
                for _, item in ipairs(itemCache) do
                    if not item.noPosition then
                        local distance = (item.position - playerPos).Magnitude
                        
                        if distance < 30 and not IsPositionOnMyPlot(item.position) then
                            local key = item.nameLower .. "_near_player"
                            
                            if not SeenItems[key] then
                                local alreadyPending = false
                                for _, pending in ipairs(PendingSteals) do
                                    if pending.nameLower == item.nameLower then
                                        alreadyPending = true
                                        break
                                    end
                                end
                                
                                if not alreadyPending then
                                    SeenItems[key] = true
                                    warn("[DEBUG] Detected potential steal near player: " .. item.name)
                                    local plotOwner, _ = GetPlotOwner(item.position)
                                    
                                    -- Try to get Discord ID from your external script
                                    -- If you have a function like getDiscordId(plotOwner), use it here
                                    local discordId = getgenv().getDiscordId and getgenv().getDiscordId(plotOwner) or ""
                                    
                                    TrackSteal(item.name, item.generation, item.position)
                                    TrackPendingSteal(item.name, item.generation, plotOwner, discordId)
                                end
                            end
                        end
                    end
                end
            end)
        end
    end)
end

